import logo from './logo.svg';
import './App.css';
import React from 'react';


function Tile() {
    return (
      <button className="tile">

      </button>
    );
}

class Board extends React.Component {
  constructor(props) {
    super(props);
  }
  renderTile() {
    return (
      <Tile>

      </Tile>
    );

  }
  render() {
    return(
      <div>

      </div>
    );

  }
}

class Game extends React.Component {
  render() {
    return (
      <div className="game">
        <div className="game-info">
          <h3>
            This is a big header
          </h3>
        </div>
        <div className="game-board">
          <Board />
        </div>

      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <div className="Game">
        <Game />
      </div>
    </div>
  );
}



export default App;
